import React, { useState, useContext } from "react";
import { Link, useParams } from "react-router-dom";
import Question from "../components/Question";
import { Context } from "../Context";

function FbCategory() {
  //get tenant id from url
  const { tenantId } = useParams();
  //Context: Fb Checklist
  const { fbChecklistState } = useContext(Context);
  //Context: to call update audits function after clicking submit
  const { updateAudit } = useContext(Context);
  //Context: tenants state
  const { tenants } = useContext(Context);

  const tenantObject = tenants.find((tenant) => tenant.tenantid === tenantId);
  //destructure tenantObject
  const { tenantid, tenantName, status, institution } = tenantObject;

  return (
    <div className="category-head">
      <h2>FB Checklist</h2>
      {fbChecklistState.map((question, index) => {
        const { id, text } = question;
        return <Question key={index} id={id} text={text} tenantId={tenantId} />;
      })}
      <br />
      <Link to={`/tenant/${tenantId}`}>
        <button
          onClick={() => {
            updateAudit(tenantId, "FB", tenantName, "unresolved");
          }}
        >
          Submit
        </button>
      </Link>
    </div>
  );
}

export default FbCategory;
